import React from 'react';
import HomePage  from './components/HomePage/HomePage';
import Navigation from './components/Navigation';
import Footer from './components/Footer';

function App() {
  return (
    <div>
      <Navigation />
      <HomePage />
      <Footer />
    </div>
  );
}

export default App;
